        <path fill="#435fbc" stroke-width="3" stroke-linejoin="round" d="M4,0L169.8,0C172.5,0,173.8,1.3,173.8,4L173.8,52C173.8,54.7,172.5,56,169.8,56L4,56C1.3,56,0,54.7,0,52L0,4C0,1.3,1.3,0,4,0z" stroke="#435fbc"/>
        <text class="st1">
            <tspan style="white-space:pre" y="34.3" x="21">第14章 高级I/O</tspan>
        </text>
    </g>
    <g id="102" ed:layout="rightmap" ed:parentid="101" transform="matrix(1,0,0,1,260,63)" ed:height="37.6" ed:width="111.8">
        <path fill="#ebecf3" stroke-linejoin="round" d="M4,0L107.8,0C110.5,0,111.8,1.3,111.8,4L111.8,33.6C111.8,36.3,110.5,37.6,107.8,37.6L4,37.6C1.3,37.6,0,36.3,0,33.6L0,4C0,1.3,1.3,0,4,0z" stroke="#ebecf3"/>
        <text class="st2">
            <tspan style="white-space:pre" y="23.8" x="18">非阻塞I/O</tspan>
        </text>
    </g>
    <g id="104" ed:layout="rightmap" ed:parentid="102" transform="matrix(1,0,0,1,399,119)" ed:height="23.9" ed:width="222">
        <path fill="none" stroke-linejoin="round" d="M0,23.9L222,23.9" stroke="#696969"/>
        <text class="st3">
            <tspan style="white-space:pre" y="16.1" x="8">当采用轮询方法时，浪费CPU时间</tspan>
        </text>
    </g>
    <g id="106" ed:layout="rightmap" ed:parentid="101" transform="matrix(1,0,0,1,260,1577)" ed:height="37.6" ed:width="95.8">
        <path fill="#ebecf3" stroke-linejoin="round" d="M4,0L91.8,0C94.5,0,95.8,1.3,95.8,4L95.8,33.6C95.8,36.3,94.5,37.6,91.8,37.6L4,37.6C1.3,37.6,0,36.3,0,33.6L0,4C0,1.3,1.3,0,4,0z" stroke="#ebecf3"/>
        <text class="st2">
            <tspan style="white-space:pre" y="23.8" x="18">异步I/O</tspan>
        </text>
    </g>
    <g id="108" ed:layout="rightmap" ed:parentid="106" transform="matrix(1,0,0,1,383,1367)" ed:height="23.9" ed:width="433.2">
        <path fill="none" stroke-linejoin="round" d="M0,23.9L433.2,23.9" stroke="#696969"/>
        <text class="st3">
            <tspan style="white-space:pre" y="16.1" x="8">采用信号，当描述符准备好可以进行I/O时，进程用一个信号告诉内核</tspan>
        </text>
    </g>
    <g id="110" ed:layout="rightmap" ed:parentid="106" transform="matrix(1,0,0,1,383,1422)" ed:height="23.9" ed:width="72.40000000000001">
        <path fill="none" stroke-linejoin="round" d="M0,23.9L72.4,23.9" stroke="#696969"/>
        <text class="st3">
            <tspan style="white-space:pre" y="16.1" x="8">技术问题</tspan>
        </text>
    </g>
    <g id="112" ed:layout="rightmap" ed:parentid="110" transform="matrix(1,0,0,1,482,1398)" ed:height="23.9" ed:width="113.2">
        <path fill="none" stroke-linejoin="round" d="M0,23.9L113.2,23.9" stroke="#696969"/>
        <text class="st3">
            <tspan style="white-space:pre" y="16.1" x="8">①可移植性问题</tspan>
        </text>
    </g>
    <g id="114" ed:layout="rightmap" ed:parentid="110" transform="matrix(1,0,0,1,482,1428)" ed:height="42.3" ed:width="514">
        <path fill="none" stroke-linejoin="round" d="M0,42.3L514,42.3" stroke="#696969"/>
        <text class="st3">
            <tspan style="white-space:pre" y="16.1" x="8">②信号对每个进程而言只有一个（SIGPOLL或SIGIO），若进程从两个描述符读，</tspan>
            <tspan style="white-space:pre" y="34.5" x="8">当进程接收到信号时，无法判别是哪一个描述符准备好了</tspan>
        </text>
    </g>
    <g id="116" ed:layout="rightmap" ed:parentid="102" transform="matrix(1,0,0,1,399,21)" ed:height="23.9" ed:width="222.8">
        <path fill="none" stroke-linejoin="round" d="M0,23.9L222.8,23.9" stroke="#696969"/>
        <text class="st3">
            <tspan style="white-space:pre" y="16.1" x="8">将描述符设为O_NONBLOCK标志</tspan>
        </text>
    </g>
    <g id="118" ed:layout="rightmap" ed:parentid="101" transform="matrix(1,0,0,1,260,286)" ed:height="37.6" ed:width="87">
        <path fill="#ebecf3" stroke-linejoin="round" d="M4,0L83,0C85.7,0,87,1.3,87,4L87,33.6C87,36.3,85.7,37.6,83,37.6L4,37.6C1.3,37.6,0,36.3,0,33.6L0,4C0,1.3,1.3,0,4,0z" stroke="#ebecf3"/>
        <text class="st2">
            <tspan style="white-space:pre" y="23.8" x="18">记录锁</tspan>
        </text>
    </g>
    <g id="119" ed:layout="rightmap" ed:parentid="102" transform="matrix(1,0,0,1,399,51)" ed:height="60.7" ed:width="514">
        <path fill="none" stroke-linejoin="round" d="M0,60.7L514,60.7" stroke="#696969"/>
        <text class="st3">
            <tspan style="white-space:pre" y="16.1" x="8">非阻塞I/O能使我们可以发出open、read和write这样的I/O操作，并使这些操作不</tspan>
            <tspan style="white-space:pre" y="34.5" x="8">会永远阻塞。如果这种操作不能完成，则调用立即出错返回，表示该操作如继续执</tspan>
            <tspan style="white-space:pre" y="52.9" x="8">行将阻塞</tspan>
        </text>
    </g>
    <g id="122" ed:layout="rightmap" ed:parentid="118" transform="matrix(1,0,0,1,374,176)" ed:height="23.9" ed:width="99.59999999999999">
        <path fill="none" stroke-linejoin="round" d="M0,23.9L99.6,23.9" stroke="#696969"/>
        <text class="st3">
            <tspan style="white-space:pre" y="16.1" x="8">是字节范围锁</tspan>
        </text>
    </g>
    <g id="124" ed:layout="rightmap" ed:parentid="118" transform="matrix(1,0,0,1,374,308)" ed:height="23.9" ed:width="353.2">
        <path fill="none" stroke-linejoin="round" d="M0,23.9L353.2,23.9" stroke="#696969"/>
        <text class="st3">
            <tspan style="white-space:pre" y="16.1" x="8">int fcntl(int fd, int cmd, .../*struct flock *flockptr  */);</tspan>
        </text>
    </g>
    <g id="126" ed:layout="rightmap" ed:parentid="124" transform="matrix(1,0,0,1,754,246)" ed:height="23.9" ed:width="46.8">
        <path fill="none" stroke-linejoin="round" d="M0,23.9L46.8,23.9" stroke="#696969"/>
        <text class="st3">
            <tspan style="white-space:pre" y="16.1" x="8">cmd</tspan>
        </text>
    </g>
    <g id="128" ed:layout="rightmap" ed:parentid="124" transform="matrix(1,0,0,1,754,363)" ed:height="23.9" ed:width="403.6">
        <path fill="none" stroke-linejoin="round" d="M0,23.9L403.6,23.9" stroke="#696969"/>
        <text class="st3">
            <tspan style="white-space:pre" y="16.1" x="8">第三个参数是指向flock结构的指针，该结构包括锁类型、锁范围</tspan>
        </text>
    </g>
    <g id="132" ed:layout="rightmap" ed:parentid="126" transform="matrix(1,0,0,1,828,206)" ed:height="23.9" ed:width="450">
        <path fill="none" stroke-linejoin="round" d="M0,23.9L450,23.9" stroke="#696969"/>
        <text class="st3">
            <tspan style="white-space:pre" y="16.1" x="8">F_GETLK，判断由flockptr所描述的锁是否会被另外一把锁排斥（阻塞）</tspan>
        </text>
    </g>
    <g id="134" ed:layout="rightmap" ed:parentid="126" transform="matrix(1,0,0,1,828,236)" ed:height="42.3" ed:width="514">
        <path fill="none" stroke-linejoin="round" d="M0,42.3L514,42.3" stroke="#696969"/>
        <text class="st3">
            <tspan style="white-space:pre" y="16.1" x="8">F_SETLK，设置由flockptr所描述的锁，也用来清除由flockptr指定的锁（l_type为</tspan>
            <tspan style="white-space:pre" y="34.5" x="8">F_UNLCK）</tspan>
        </text>
    </g>
    <g id="136" ed:layout="rightmap" ed:parentid="126" transform="matrix(1,0,0,1,828,285)" ed:height="23.9" ed:width="232.4">
        <path fill="none" stroke-linejoin="round" d="M0,23.9L232.4,23.9" stroke="#696969"/>
        <text class="st3">
            <tspan style="white-space:pre" y="16.1" x="8">F_SETLKW，是F_SETLK的阻塞版本</tspan>
        </text>
    </g>
    <g id="138" ed:layout="rightmap" ed:parentid="101" transform="matrix(1,0,0,1,260,882)" ed:height="37.6" ed:width="127.8">
        <path fill="#ebecf3" stroke-linejoin="round" d="M4,0L123.8,0C126.5,0,127.8,1.3,127.8,4L127.8,33.6C127.8,36.3,126.5,37.6,123.8,37.6L4,37.6C1.3,37.6,0,36.3,0,33.6L0,4C0,1.3,1.3,0,4,0z" stroke="#ebecf3"/>
        <text class="st2">
            <tspan style="white-space:pre" y="23.8" x="18">I/O多路转接</tspan>
        </text>
    </g>
    <g id="140" ed:layout="rightmap" ed:parentid="138" transform="matrix(1,0,0,1,415,468)" ed:height="42.3" ed:width="514">
        <path fill="none" stroke-linejoin="round" d="M0,42.3L514,42.3" stroke="#696969"/>
        <text class="st3">
            <tspan style="white-space:pre" y="16.1" x="8">先构造一张我们感兴趣的描述符列表，然后调用一个函数，直到这些描述符中的一</tspan>
            <tspan style="white-space:pre" y="34.5" x="8">个已准备好进行I/O时，该函数才返回</tspan>
        </text>
    </g>
    <g id="142" ed:layout="rightmap" ed:parentid="156" transform="matrix(1,0,0,1,956,516)" ed:height="23.9" ed:width="254">
        <path fill="none" stroke-linejoin="round" d="M0,23.9L254,23.9" stroke="#696969"/>
        <text class="st3">
            <tspan style="white-space:pre" y="16.1" x="8">select函数可以使我们执行I/O多路转接</tspan>
        </text>
    </g>
    <g id="144" ed:layout="rightmap" ed:parentid="156" transform="matrix(1,0,0,1,956,608)" ed:height="23.9" ed:width="99.59999999999999">
        <path fill="none" stroke-linejoin="round" d="M0,23.9L99.6,23.9" stroke="#696969"/>
        <text class="st3">
            <tspan style="white-space:pre" y="16.1" x="8">参数告诉内核</tspan>
        </text>
    </g>
    <g id="146" ed:layout="rightmap" ed:parentid="144" transform="matrix(1,0,0,1,1082,547)" ed:height="23.9" ed:width="162">
        <path fill="none" stroke-linejoin="round" d="M0,23.9L162,23.9" stroke="#696969"/>
        <text class="st3">
            <tspan style="white-space:pre" y="16.1" x="8">1）我们所关心的描述符</tspan>
        </text>
    </g>
    <g id="148" ed:layout="rightmap" ed:parentid="144" transform="matrix(1,0,0,1,1082,577)" ed:height="23.9" ed:width="406.8">
        <path fill="none" stroke-linejoin="round" d="M0,23.9L406.8,23.9" stroke="#696969"/>
        <text class="st3">
            <tspan style="white-space:pre" y="16.1" x="8">2）对于每个描述符我们关心的条件（对描述符的读、写或异常）</tspan>
        </text>
    </g>
    <g id="150" ed:layout="rightmap" ed:parentid="144" transform="matrix(1,0,0,1,1082,608)" ed:height="23.9" ed:width="420.4">
        <path fill="none" stroke-linejoin="round" d="M0,23.9L420.4,23.9" stroke="#696969"/>
        <text class="st3">
            <tspan style="white-space:pre" y="16.1" x="8">3）愿意等待多长时间（永远等待、等待一个固定值或根本不等待）</tspan>
        </text>
    </g>
    <g id="152" ed:layout="rightmap" ed:parentid="144" transform="matrix(1,0,0,1,1082,638)" ed:height="23.9" ed:width="189.2">
        <path fill="none" stroke-linejoin="round" d="M0,23.9L189.2,23.9" stroke="#696969"/>
        <text class="st3">
            <tspan style="white-space:pre" y="16.1" x="8">4）已准备好描述符的总数量</tspan>
        </text>
    </g>
    <g id="154" ed:layout="rightmap" ed:parentid="144" transform="matrix(1,0,0,1,1082,668)" ed:height="23.9" ed:width="284.4">
        <path fill="none" stroke-linejoin="round" d="M0,23.9L284.4,23.9" stroke="#696969"/>
        <text class="st3">
            <tspan style="white-space:pre" y="16.1" x="8">5）对于读、写或异常，哪些描述符已准备好</tspan>
        </text>
    </g>
    <g id="156" ed:layout="rightmap" ed:parentid="138" transform="matrix(1,0,0,1,415,778)" ed:height="60.7" ed:width="514">
        <path fill="none" stroke-linejoin="round" d="M0,60.7L514,60.7" stroke="#696969"/>
        <text class="st3">
            <tspan style="white-space:pre" y="16.1" x="8">#include&lt;sys/select.h></tspan>
            <tspan style="white-space:pre" y="34.5" x="8">int select(int maxfdp1, fd_set *readfds, fd_set *writefds, fd_set *exceptfds, </tspan>
            <tspan style="white-space:pre" y="52.9" x="8">struct timeval *tvptr);  返回准备就绪的描述符数目</tspan>
        </text>
    </g>
    <g id="158" ed:layout="rightmap" ed:parentid="156" transform="matrix(1,0,0,1,956,879)" ed:height="42.3" ed:width="514">
        <path fill="none" stroke-linejoin="round" d="M0,42.3L514,42.3" stroke="#696969"/>
        <text class="st3">
            <tspan style="white-space:pre" y="16.1" x="8">readfds、writefds、exceptfds是指向描述符集的指针，每个描述符集存储在一个</tspan>
            <tspan style="white-space:pre" y="34.5" x="8">fd_set数据结构中</tspan>
        </text>
    </g>

    <g id="176" ed:layout="rightmap" ed:parentid="174" transform="matrix(1,0,0,1,814,1190)" ed:height="60.7" ed:width="514">
        <path fill="none" stroke-linejoin="round" d="M0,60.7L514,60.7" stroke="#696969"/>
        <text class="st3">
            <tspan style="white-space:pre" y="16.1" x="8">与select不同，poll不是为每个条件（可读性、可写性和异常条件）构造一个描述</tspan>
            <tspan style="white-space:pre" y="34.5" x="8">符表，而是构造一个pollfd结构的数组，每个数组元素指定一个描述符编号以及我</tspan>
            <tspan style="white-space:pre" y="52.9" x="8">们对该描述符感兴趣的条件</tspan>
        </text>
    </g>
